import FormElement from "../FormElement";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <form>
      <FormElement type="text" value={name} label="Name:" id="name" onChange={e => setName(e.target.value)}  />


    </form>
  );
};
